const SWAPI_ROOT = 'https://swapi.dev/ap/';
const SWAPI_PEOPLE = 'people';

const getApiResource = async () => {
    let data;
    try {
        data = await (await fetch(SWAPI_ROOT+SWAPI_PEOPLE)).json();
    }
    catch(error) {
        console.log(error);
    }
    // .then(res => {
    //     return res.json()
    //     console.log()
    // })
    // .then(res => console.log(res))
    // .catch(error => console.log(error));

    console.log('getApiResource');
    console.log(data);
}

getApiResource();
export {getApiResource};
